import { Component } from '@angular/core';
import { Person } from './person';

@Component({
  selector: 'app-person',
  templateUrl: './person.component.html',
  styleUrls: ['./person.component.css']
})
export class PersonComponent {
  //model: Person('DANE', 'CUPP', 76108);
  //model: Person | undefined;
  model = new Person('Dane', 'Cupp', 76108);


  onSubmit() {
    console.log('onSubmit()');
    console.log(this.model);
  }


  addNew() {
   

    console.log('Add New Clicked()');
    console.log(this.model);
  }

}

<form (ngSubmit)="onSubmit()">
  <div>
    <label for="firstName">First Name:</label>
    <input type="text" #name="ngModel" [(ngModel)]="model.firstName" required />
    {{name.valid}}
  </div>
  <div>
    <label for="lastName">Last Name:</label>
    <input type="text" name="lastName" [(ngModel)]="model.lastName" required />
  </div>
  <div>
    <label for="zip">Zip Code:</label>
    <input type="number" name="zip" name="zip" [(ngModel)]="model.zipCode" required />
  </div>

  <button type="submit" id="cmdSubmit" (click)="addNew();">Add New</button>
</form>
